void cpu_op_0000a(void) /* OR */ {
  /* mask fff8, bits 0000, mnemonic 1, priv 0, endblk 0, imm_notzero 0, used 0
     set -2, size 1, stype 11, dtype 0, sbitpos 0, dbitpos 0, immvalue 0 */
  uint8 srcdata = fetchword(PC);
  const int dstreg = (0x0000 >> 0) & 7;
  uint8 dstdata = DATAREG(dstreg);
  uint8 outdata = dstdata;

  outdata|= srcdata;
  DATAREG(dstreg) = (DATAREG(dstreg) & ~0xff) | outdata;
}

